import React from "react";
import { useParams } from "react-router-dom";

function ProfilePage({ getUser }) {
  const { em } = useParams();
  const user = getUser.find(({ email }) => email === em);
  console.log(em);
  return (
    <div>
      <img src={user.picture} alt="" />
      <h1>{user.email}</h1>
    </div>
  );
}

export default ProfilePage;
